    return (
      <div
        className="container-fluid"
        style={{
          justifyContent: "space-around",
          display: "flex",
          position: "absolute",
        }}
      >
        <div style={{ display: "flex" }}>
          <div style={{ margin: "2%", verticalAlign: "middle" }}>picture</div>{" "}
          <div style={{ width: "100px" }}>
            DAPP <div>Staking Bank</div>
          </div>{" "}
        </div>
        <div>0x12918298329382938293892389</div>
      </div>
    );
  }
}

export default Navbar;
